import { Navigate } from 'react-router-dom';
import { RootState } from '../../redux/store';

const PrivateRoute = ({ currentUser, children, redirectTo }: any) => {
  if (!currentUser) return <Navigate to={redirectTo} />;

  return children;
};

export default PrivateRoute;
